import React from 'react';
import './Profile.css';

const Profile = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
  }

  return (
    <div id='edit-profile'>
      <h2>Edição de perfil</h2>
      <p className='subtitle'>Adicione uma imagem de perfil ou altere alguma informação.</p>
      {/* {preview de imagem} */}
      <form onSubmit={handleSubmit}></form>
    </div>
  )
}

export default Profile
